import React from 'react';

const Username = (props)=>{

	return(
		<div>
		<Form onClick={props.onClick}>
            <input type="text" 
         	placeholder="Username" 
            value={props.value} 
            onChange={props.onChange} 
            disabled = {props.disabled}
            className="form-control"/>
        </Form>
        </div>

	);

}


export default Username;
